{id:1,module:1,domain:'craft_structure',passage:"The National Heritage Fellowship was created to honor exceptional folk and traditional artists in the United States. In 2008, the fellowship was given to quilter Bettye Kimbrell. Kimbrell was ______ to receive it because of the lifetime contribution to the arts.",text:'Which choice completes the text with the most logical and precise word or phrase?',type:'multipleChoice',options:[{letter:'A',text:'confused'},{letter:'B',text:'ineligible'},{letter:'C',text:'reluctant'},{letter:'D',text:'chosen'}],correctAnswer:'D'},// Question 2 - Answer: B
{id:2,module:1,domain:'craft_structure',passage:"The following text is adapted from Willa Cather's 1912 novel Alexander's Bridge.\n\nFor the next few days Alexander was very busy. He took a desk in the office of a Scottish engineering firm on Henrietta Street, and was at work almost constantly. He avoided the clubs and usually dined alone at his hotel.",text:'As used in the text, what does the word "constantly" most nearly mean?',type:'multipleChoice',options:[{letter:'A',text:'Enough'},{letter:'B',text:'Nonstop'},{letter:'C',text:'Quickly'},{letter:'D',text:'Fearfully'}],correctAnswer:'B'},// Question 3 - Answer: A
{id:3,module:1,domain:'craft_structure',passage:"According to a team of neuroeconomists from the University of Zurich, ease of decision making may be linked to communication between two brain regions, the prefrontal cortex and the parietal cortex. Individuals tend to be more decisive if the information flow between the regions is intensified, whereas they make choices more slowly when information flow is ______",text:'Which choice completes the text with the most logical and precise word or phrase?',type:'multipleChoice',options:[{letter:'A',text:'reduced'},{letter:'B',text:'evaluated'},{letter:'C',text:'determined'},{letter:'D',text:'acquired'}],correctAnswer:'A'},// Question 4 - Answer: B
{id:4,module:1,domain:'craft_structure',passage:"Ecologist Exequiel Ezcurra and colleagues found that the inhabitants of the Mexica empire used natural landmarks to track time with a high degree of ______. By observing the sun's position in relation to various points on the mountains surrounding the Basin of Mexico, the Mexica were able to precisely identify the dates when significant events such as solstices occurred.",text:'Which choice completes the text with the most logical and precise word or phrase?',type:'multipleChoice',options:[{letter:'A',text:'precariousness'},{letter:'B',text:'exactitude'},{letter:'C',text:'resilience'},{letter:'D',text:'inconspicuousness'}],correctAnswer:'B'},// Question 5 - Answer: D
{id:5,module:1,domain:'information_ideas',passage:"Steepletop in Austerlitz, New York, is the house where Edna St. Vincent Millay lived for twenty-five years and wrote many of her poems. Now the house is a museum dedicated to Millay's life and writings. Visitors travel to this museum to feel more connected to an author they admire. To encourage that sense of connection, the museum's curators recommend nearby hiking trails and outdoor activities. Such activities help visitors appreciate the natural scenery that inspired Millay.",text:'Which choice best states the main purpose of the text?',type:'multipleChoice',options:[{letter:'A',text:'To compare Steepletop with other museums'},{letter:'B',text:'To explain why readers enjoy Millay\'s works'},{letter:'C',text:'To summarize Millay\'s biography'},{letter:'D',text:'To describe a museum focused on Millay\'s life and works'}],correctAnswer:'D'},// Question 6 - Answer: D
{id:6,module:1,domain:'craft_structure',passage:"Sheep and falcons can see in three dimensions (3D), which helps them perceive distance and depth. Octopuses and squid are thought to lack 3D vision. Many researchers once thought the same about cuttlefish, but Trevor Wardill and his team wanted to test whether this assumption was true. The team studied how cuttlefish wearing 3D glasses reacted to 3D images of shrimp (a favorite prey) projected on a tank wall. Cuttlefish changed their striking position to match the 3D images, suggesting that their vision is more like that of sheep and falcons than that of octopuses or squid.",text:'Which choice best states the function of the underlined sentence in the text as a whole?',type:'multipleChoice',options:[{letter:'A',text:'It explains how 3D vision in sheep and falcons differs from the type of 3D vision discussed in the text.'},{letter:'B',text:'It explains why the animals discussed in the text were once thought to lack 3D vision.'},{letter:'C',text:'It offers a suggestion for future research on the aspect of 3D vision discussed in the text.'},{letter:'D',text:'It presents the results of the study of 3D vision discussed in the text.'}],correctAnswer:'D'},// Question 7 - Answer: A
{id:7,module:1,domain:'craft_structure',passage:"Mexico City has high pedestrian traffic, but simply replicating a feature of Mexico City associated with walkability\u2014e.g., its high block density\u2014may be insufficient to induce increased walking in other cities. As urbanist Mariela Alfonzo argues, our understanding of individuals' decision-making about whether to walk is insufficiently robust: some studies emphasize the role of sidewalk width, others the role of neighborhood attractiveness, and so on, but walking decisions are made in complex contexts in which multiple conditions and needs inform individuals' choices.",text:'Which choice best describes the function of the references to "sidewalk width" and "neighborhood attractiveness" in the text as a whole?',type:'multipleChoice',options:[{letter:'A',text:'They represent factors that have been identified as important influences on walking decisions but that the text suggests are merely some of the many factors that may contribute to people\'s decision-making about walking.'},{letter:'B',text:'They illustrate factors that researchers believe people consider when making walking decisions in most contexts but that the text argues are unique to walking decisions made by people in Mexico City.'},{letter:'C',text:'They identify factors that Alfonzo argues have been overemphasized in studies of decision-making about walking but that the text asserts are relevant to most people\'s walking decisions.'},{letter:'D',text:'They are examples of factors that studies suggest are important in people\'s decision-making about walking but that the text claims most people rarely consider when making walking decisions.'}],correctAnswer:'A'},// Question 8 - Answer: D
{id:8,module:1,domain:'information_ideas',passage:"The following text is Emily Dickinson's circa 1873 poem \"There is no Frigate like a Book\". A frigate is a light fast ship; coursers are swift horses.\n\nThere is no Frigate like a Book\nTo take us Lands away\nNor any Coursers like a Page\nOf prancing Poetry\u2014\nThis Traverse may the poorest take\nWithout oppress of Toll\u2014\nHow frugal is the Chariot\nThat bears the Human soul.",text:'Which choice best states the main idea of the text?',type:'multipleChoice',options:[{letter:'A',text:'Reading gives people a reprieve from the financial focus of modern life.'},{letter:'B',text:'Poetry can forge connections between people from different communities.'},{letter:'C',text:'People can learn more about distant places by reading books than by traveling to those places.'},{letter:'D',text:'Literature can metaphorically transport people to new places regardless of their means.'}],correctAnswer:'D'},// Question 9 - Answer: D
{id:9,module:1,domain:'information_ideas',passage:"Tanya Tagaq is a writer and musician and a member of the Inuit community of Cambridge Bay in northern Canada. Critics and fellow writers have praised her work for combining traditional Inuit stories with popular genres of literature, such as fantasy fiction. But Tagaq is not the only Indigenous writer to blend traditional stories with popular literature. In the 2016 novel Wrist, Nathan Niigan Noodin Adler successfully blended the oral storytelling tradition of their people, the Anishinaabe, with horror fiction.",text:'Which choice best states the main idea of the text?',type:'multipleChoice',options:[{letter:'A',text:'Several famous Indigenous writers increased their book sales when they began incorporating traditional stories.'},{letter:'B',text:'The success of Tanya Tagaq has influenced non-Indigenous authors who write in popular literary genres.'},{letter:'C',text:'Non-Indigenous authors should consider the experience of Indigenous readers.'},{letter:'D',text:'Recent Indigenous fiction writers are mixing traditional stories with popular literary genres.'}],correctAnswer:'D'},// Question 10 - Answer: A
{id:10,module:1,domain:'information_ideas',passage:"Uncle Vanya: Scenes From Country Life in Four Acts is an 1898 play by Anton Chekhov, originally written in Russian. In the play, professor Serebryakov and his wife Helena have come to stay at their country estate which Vanya manages with the help of Sonya, the professor's daughter from a previous marriage. Chekhov portrays the professor as being unable to adjust to living at the country estate, as is evident when ______",text:'Which quotation from a translation of Uncle Vanya most effectively illustrates the claim?',type:'multipleChoice',options:[{letter:'A',text:'Professor Serebryakov says to Helena, "I am used to my library and the lecture hall and to the esteem and admiration of my colleagues... suddenly find myself plunged into this wilderness [the estate], condemned to see the same stupid people from morning till night and listen to their futile conversations."'},{letter:'B',text:'Professor Serebryakov says, "I am a book-worm and a scholar, and am unfamiliar with practical affairs. I cannot, I find, dispense with the help of well-informed people."'},{letter:'C',text:'Vanya says to himself, "Professor Serebryakov is absolutely unknown, and his fame has burst like a soap-bubble."'},{letter:'D',text:'Professor Serebryakov says to Helena, "Ever since I have been old, I have been hateful to myself, and I am sure, hateful to you all as well."'}],correctAnswer:'A'},// Question 11 - Answer: D
{id:11,module:1,domain:'information_ideas',passage:"Fish whose DNA has been modified to include genetic material from other species are known as transgenic. Some transgenic fish have genes from jellyfish that result in fluorescence (that is, they glow in the dark). Although these fish were initially engineered for research purposes in the 1990s, they were sold as pets in the 2000s and can now be found in the wild in creeks in Brazil. A student in a biology seminar who is writing a paper on these fish asserts that their escape from Brazilian fish farms into the wild may have significant negative long-term ecological effects.",text:'Which quotation from a researcher would best support the student\'s assertion?',type:'multipleChoice',options:[{letter:'A',text:'"In one site in the wild where transgenic fish were observed, females outnumbered males, while in another the numbers of females and males were equivalent."'},{letter:'B',text:'"Though some presence of transgenic fish in the wild has been recorded, there are insufficient studies of the impact of those fish on the ecosystems into which they are introduced."'},{letter:'C',text:'"The ecosystems into which transgenic fish are known to have been introduced may represent a subset of the ecosystems into which the fish have actually been introduced."'},{letter:'D',text:'"Through interbreeding, transgenic fish might introduce the trait of fluorescence into wild fish populations, making those populations more vulnerable to predators."'}],correctAnswer:'D'},// Question 12 - Answer: D
{id:12,module:1,domain:'information_ideas',passage:"Contributions of Three Key Industries to Oklahoma Economy in 2017\n\n| Industry | Approximate Contribution |\n|----------|--------------------------|\n| Tribal economic activity | $7,312,400,000 |\n| Construction | $6,797,300,000 |\n| Health care | $13,727,300,000 |\n\nThe Choctaw Nation, the Citizen Potawatomi Nation, and the more than thirty other tribes in Oklahoma operate numerous businesses and collectively generate billions of dollars in revenue. In fact, when the tribes' activity is regarded as a single industry, its contribution to the Oklahoma economy in 2017 ______.",text:'Which choice uses data from the table to most effectively complete the comparison?',type:'multipleChoice',options:[{letter:'A',text:'exceeded the contribution made by both construction and health care'},{letter:'B',text:'was lower than the contribution made by either construction or health care'},{letter:'C',text:'was greater than the contribution made by health care but equal to that made by construction'},{letter:'D',text:'surpassed the contribution made by construction but fell short of that made by health care'}],correctAnswer:'D'},// Question 13 - Answer: D
{id:13,module:1,domain:'information_ideas',passage:"Peering at Adult Orangutans by Immature Orangutans\n\n| Individual | Site | Sex | Total peering events | Proportion at immigrants |\n|-----------|------|-----|---------------------|--------------------------|\n| 1 | Suaq | female | 17 | 0.41 |\n| 2 | Suaq | female | 23 | 0.13 |\n| 8 | Tuanan | male | 1 | 1.00 |\n| 16 | Suaq | male | 80 | 0.84 |\n\nOne way that young orangutans acquire foraging skills is through a behavior scientists call peering\u2014closely watching older orangutans. Since male orangutans typically leave the area of their birth upon maturity and females do not, Beatrice Ehmann and her colleagues hypothesized that it is more advantageous for immature males than females to devote attention to orangutans who are immigrants to the home region of the immature individual.",text:'Which choice best describes data from the table that support Ehmann and colleagues\' hypothesis?',type:'multipleChoice',options:[{letter:'A',text:'The proportion of peering events directed at immigrants ranged from 0.13 to 1.00.'},{letter:'B',text:'Individual 8 directed a higher proportion at immigrants than did individual 16, and individual 1 directed a higher proportion than did individual 2.'},{letter:'C',text:'Individual 16 had the highest total number of peering events at 80.'},{letter:'D',text:'Individual 2 and individual 1 directed a lower proportion of peering events at immigrants to their home regions than did individual 8 and individual 16.'}],correctAnswer:'D'},// Question 14 - Answer: D
{id:14,module:1,domain:'information_ideas',passage:"In June of 1986, India liberalized its stock market, meaning that it began allowing foreign individuals and businesses to invest money in Indian companies. This was part of a wave of stock market liberalizations around the world\u2014Malaysia in 1987, Pakistan in 1991, and so on. The standard view among economists at the time was that liberalization would make it easier for companies to raise money from investors. Economist Peter Blair Henry examined the economies of 11 countries that were part of the liberalization wave and found that, on average, companies based in those countries received significant increases in investment in the three years following liberalization, suggesting that ______",text:'Which choice most logically completes the text?',type:'multipleChoice',options:[{letter:'A',text:'companies in Malaysia experienced a greater increase in investment following liberalization than did companies in India.'},{letter:'B',text:'companies did not benefit from liberalization until at least three years after liberalization occurred.'},{letter:'C',text:'economists who held the standard view of liberalization failed to anticipate some serious negative effects of liberalization.'},{letter:'D',text:'empirical evidence was consistent with the scholarly consensus about the consequences of liberalization.'}],correctAnswer:'D'},// Question 15 - Answer: D
{id:15,module:1,domain:'information_ideas',passage:"Buried collections of Bronze Age metal items (called hoards) have been found all over Britain. For hoards discovered since the 1960s, such as the 1965 discovery of the Walderslade hoard, advancements like inexpensive metal detectors, ground-penetrating radar, and aerial surveys have made it much easier for searchers to locate hoards before putting the first shovel in the ground. Hoards found before the 1960s, however, such as the discovery of the Auchnacree hoard around 1921, were not aided by such technologies and thus were much more likely to ______",text:'Which choice most logically completes the text?',type:'multipleChoice',options:[{letter:'A',text:'include rare items from the 10th century BCE.'},{letter:'B',text:'include gold jewelry.'},{letter:'C',text:'occur before the ground was disturbed.'},{letter:'D',text:'result from artifacts being unearthed accidentally.'}],correctAnswer:'D'},// Question 16 - Answer: D
{id:16,module:1,domain:'standard_conventions',passage:"\"He was just the man for such a place, and it was just the place for such a man.\" This line is from Frederick Douglass's autobiography Narrative of the Life of Frederick Douglass (1845). It's an example of an antimetabole, a writing technique that ______ emphasis by repeating a statement in a reversed order.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'create'},{letter:'B',text:'are creating'},{letter:'C',text:'have created'},{letter:'D',text:'creates'}],correctAnswer:'D'},// Question 17 - Answer: A
{id:17,module:1,domain:'standard_conventions',passage:"Over several years, anthropologist Livia Barbosa surveyed individuals in Brazil about their eating habits, collecting data, for example, on what days of the week respondents were more likely ______ common Brazilian foods, such as galinhada (a rice and chicken stew) and misto quente (a ham and cheese sandwich).",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'to eat'},{letter:'B',text:'eating'},{letter:'C',text:'will be eating'},{letter:'D',text:'eaten'}],correctAnswer:'A'},// Question 18 - Answer: A
{id:18,module:1,domain:'standard_conventions',passage:"To coders like Black Girls Code founder Kimberly Bryant, the computer programming languages Groovy and S-Lang have a clear difference: the former is an object-oriented language while the latter is not. Because both languages require highly technical knowledge to understand, though, laypeople ______ to distinguish between them.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'struggle'},{letter:'B',text:'struggled'},{letter:'C',text:'were struggling'},{letter:'D',text:'had struggled'}],correctAnswer:'A'},// Question 19 - Answer: A
{id:19,module:1,domain:'standard_conventions',passage:"Included among a particular group of mid-twentieth-century artists known as the Washington Color School, American abstract ______ was known for using stripes and washes and for filling large canvases with fields of single colors of paint.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'painter Alma Thomas'},{letter:'B',text:'painter. Alma Thomas'},{letter:'C',text:'painter Alma Thomas,'},{letter:'D',text:'painter, Alma Thomas,'}],correctAnswer:'A'},// Question 20 - Answer: B
{id:20,module:1,domain:'standard_conventions',passage:"The Timeline of African American Music, a website that traces the history of genres such as swing and bebop, is the result of decades of research by ethnomusicologist Portia K. Maultsby. She was not alone in her ______ Maureen Mahon and Fernando Orejuela, among other scholars, also contributed to the project.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'efforts, however,'},{letter:'B',text:'efforts; however,'},{letter:'C',text:'efforts however'},{letter:'D',text:'efforts; however'}],correctAnswer:'B'},// Question 21 - Answer: C
{id:21,module:1,domain:'expression_ideas',passage:"In a 2022 analysis, researchers applied a statistical model to a set of words to infer the rate of cognate replacement\u2014the rate at which a word will be replaced over time with a noncognate form\u2014in Indo-European languages. The researchers found that negative adjectives like \"homeless\" evolve most rapidly; ______ negative nouns evolve most slowly.",text:'Which choice completes the text with the most logical transition?',type:'multipleChoice',options:[{letter:'A',text:'hence,'},{letter:'B',text:'subsequently,'},{letter:'C',text:'meanwhile,'},{letter:'D',text:'similarly,'}],correctAnswer:'C'},// Question 22 - Answer: D
{id:22,module:1,domain:'expression_ideas',passage:"In the 1880s, inventor Lewis Latimer improved upon Thomas Edison's design for the electric light bulb. Latimer made the light bulb more durable by placing cardboard around its carbon filament. ______ Latimer became the first Black inventor to contribute to the electrification of the world.",text:'Which choice completes the text with the most logical transition?',type:'multipleChoice',options:[{letter:'A',text:'Regardless,'},{letter:'B',text:'Besides,'},{letter:'C',text:'However,'},{letter:'D',text:'Specifically,'}],correctAnswer:'D'},// Question 23 - Answer: D
{id:23,module:1,domain:'expression_ideas',passage:"Soil polluted with chromium (a heavy metal) is harmful to many plants and animals, but the plant species Ludwigia prostrata, or creeping water primrose, can thrive in such conditions. ______ as a metal hyperaccumulator, Ludwigia prostrata absorbs a large amount of chromium and sequesters it in its roots and shoots, thereby reducing concentrations of this harmful substance in the soil.",text:'Which choice completes the text with the most logical transition?',type:'multipleChoice',options:[{letter:'A',text:'By contrast,'},{letter:'B',text:'Nevertheless,'},{letter:'C',text:'Consequently,'},{letter:'D',text:'What\'s more,'}],correctAnswer:'D'},// Question 24 - Answer: A
{id:24,module:1,domain:'expression_ideas',passage:"While researching a topic, a student has taken the following notes:\n\u2022 The Music by Black Composers (MBC) project aims to inspire aspiring music students by archiving and sharing information about the music of Black classical composers.\n\u2022 Logie Wright is a Black classical music composer included in MBC's Historic Composers Directory.\n\u2022 He was born in 1927 and died in 2001.\n\nThe student wants to set up a discussion of Wright's career for an audience already familiar with the MBC project.",text:'Which choice most effectively uses information from the given sentences to accomplish this goal?',type:'multipleChoice',options:[{letter:'A',text:'Among the many talented figures included in the MBC project is classical music composer Logie Wright.'},{letter:'B',text:'The MBC project\'s Historic Composers Directory highlights Black classical composers of the past, such as Logie Wright (1927-2001), in order to inspire music students to become the classical composers of the future.'},{letter:'C',text:'While Logie Wright is considered a great composer, there are many more such composers included in the MBC Historic Composers Directory.'},{letter:'D',text:'Born in 1927, Logie Wright passed away in 2001, according to the MBC project.'}],correctAnswer:'A'},// Question 25 - Answer: D
{id:25,module:1,domain:'expression_ideas',passage:"While researching a topic, a student has taken the following notes:\n\u2022 Traditionally, manufacturers have dyed denim jeans blue by dipping them in a solution containing indigo powder.\n\u2022 Indigo doesn't dissolve in just water, so manufacturers must mix hazardous chemicals with water to dissolve the powder.\n\u2022 Textile researcher Smriti Rai discovered a process for dyeing blue jeans without chemicals.\n\u2022 Rai added indigo powder to a hydrogel containing nanocellulose and produced a dye that could be spread directly onto the denim.\n\u2022 Nanocellulose is a natural, plant-based substance that separates the molecules of indigo powder.\n\nThe student wants to emphasize a difference between the two approaches to dyeing blue jeans.",text:'Which choice most effectively uses relevant information from the notes to accomplish this goal?',type:'multipleChoice',options:[{letter:'A',text:'Though created using a different process, Rai\'s dye contains the same ingredient as the dye produced by blue jean manufacturers.'},{letter:'B',text:'Nanocellulose is a natural, plant-based substance that separates the molecules of indigo powder, which doesn\'t dissolve in water.'},{letter:'C',text:'The traditional approach to dyeing blue jeans is to dip them in a solution containing hazardous chemicals.'},{letter:'D',text:'Rai\'s approach substitutes a natural, plant-based substance for the hazardous chemicals that manufacturers have traditionally used.'}],correctAnswer:'D'},// Question 26 - Answer: A
{id:26,module:1,domain:'expression_ideas',passage:"While researching a topic, a student has taken the following notes:\n\u2022 Earthquakes start at a point called a \"focus\" and spread out from there as seismic waves.\n\u2022 The two types of seismic waves that travel beneath Earth's surface are primary waves (P waves) and secondary waves (S waves).\n\u2022 P waves travel more quickly beneath Earth's surface than do S waves.\n\u2022 P waves compress and expand the ground, causing it to move backward and forward.\n\u2022 S waves cause the ground to move from side to side.\n\nThe student wants to emphasize a similarity between P waves and S waves.",text:'Which choice most effectively uses relevant information from the notes to accomplish this goal?',type:'multipleChoice',options:[{letter:'A',text:'P waves and S waves both travel beneath Earth\'s surface, causing the ground to move.'},{letter:'B',text:'P waves travel away from an earthquake\'s starting point at a higher rate of speed than do S waves.'},{letter:'C',text:'Spreading out from the focus of an earthquake, P waves move the ground backward and forward.'},{letter:'D',text:'Although P waves and S waves start at the same point, they are very different.'}],correctAnswer:'A'},// Question 27 - Answer: D
{id:27,module:1,domain:'expression_ideas',passage:"While researching a topic, a student has taken the following notes:\n\u2022 A currency is a money system.\n\u2022 Sometimes, countries adopt a new currency to replace an older one.\n\u2022 Mozambique adopted the escudo as its official currency in 1914.\n\u2022 The metical replaced the escudo in 1980.\n\u2022 The metical remains Mozambique's official currency.\n\nThe student wants to specify how long Mozambique officially used the escudo.",text:'Which choice most effectively uses relevant information from the notes to accomplish this goal?',type:'multipleChoice',options:[{letter:'A',text:'Though Mozambique currently uses the metical, the country\'s former official currency was introduced in 1914.'},{letter:'B',text:'Countries sometimes adopt new currency systems, as Mozambique did when it replaced the escudo with the metical.'},{letter:'C',text:'The metical has been Mozambique\'s official currency since 1980, when it replaced the escudo.'},{letter:'D',text:'Mozambique officially used the escudo from 1914 until 1980, when it adopted the metical.'}],correctAnswer:'D'},// ========================================
