{id:28,module:2,domain:'craft_structure',passage:"The organizers specifically indicated that the conference was intended to focus on children's literature, so despite the education specialist's ______ her expertise on the subject in general, she found that she could speak authoritatively about the works of illustrator Ashley Bryan, particularly Beat the Story Drum, Pum-Pum, which she had used effectively in classroom instruction for many years.",text:'Which choice completes the text with the most logical and precise word or phrase?',type:'multipleChoice',options:[{letter:'A',text:'insight into'},{letter:'B',text:'hesitancy about'},{letter:'C',text:'exceptions to'},{letter:'D',text:'affinity for'}],correctAnswer:'B'},// Question 2 Module 2 - Answer: B
{id:29,module:2,domain:'craft_structure',passage:"In 1891, William Morris cofounded the design studio Kelmscott Press, which printed editions of books using preindustrial methods. Historians argue that Morris's repudiation of industrialization is ______ the Kelmscott editions' use of handmade materials and intricate ornamentation reminiscent of medieval manuscripts: these meticulously handcrafted elements exemplify the artistry involved.",text:'Which choice completes the text with the most logical and precise word or phrase?',type:'multipleChoice',options:[{letter:'A',text:'insensible to'},{letter:'B',text:'manifest in'},{letter:'C',text:'scrutinized by'},{letter:'D',text:'complicated by'}],correctAnswer:'B'},// Question 3 Module 2 - Answer: D
{id:30,module:2,domain:'craft_structure',passage:"It is tempting to treat the clustering of information technology firms in Northern California as representative of industrial agglomeration generally, but Giulia Faggio et al. caution against ______ this one example: the potential for knowledge spillovers, a dominant driver of collocation in this industry, was largely absent from the paint manufacturing industry.",text:'Which choice completes the text with the most logical and precise word or phrase?',type:'multipleChoice',options:[{letter:'A',text:'corroborating'},{letter:'B',text:'convening with'},{letter:'C',text:'scrutinizing'},{letter:'D',text:'extrapolating from'}],correctAnswer:'D'},// Question 4 Module 2 - Answer: B
{id:31,module:2,domain:'craft_structure',passage:"A number of recording artists ______ distinctions between Indigenous music and other musical styles. For example, Choctaw singer-songwriter Samantha Crain incorporated elements of Choctaw hymns into folk-pop on her single \"When We Remain\" and Swinomish musician Black Belt Eagle Scout combined powwow-style melodies with rock on her album At the Party with My Brown Friends.",text:'Which choice completes the text with the most logical and precise word or phrase?',type:'multipleChoice',options:[{letter:'A',text:'reject'},{letter:'B',text:'blur'},{letter:'C',text:'replace'},{letter:'D',text:'disguise'}],correctAnswer:'B'},// Question 5 Module 2 - Answer: D
{id:32,module:2,domain:'craft_structure',passage:"Mahmoud Reza Hemami and colleagues showed that high moonlight intensity inhibits the activity of the Iranian jerboa (Allactaga firouzi), a result explicable in terms of benefits and costs; greater lunar intensity may not enable the jerboas to increase foraging success enough to offset the higher chance of detection by predatory jackals or owls. Most other nocturnal mammals respond to lunar intensity variations similarly to Iranian jerboas, but Azara's night monkeys (Aotus azarae) display the opposite pattern, as their heavy reliance on visual foraging results in a different balance of reward and risk.",text:'Which choice best describes the overall structure of the text?',type:'multipleChoice',options:[{letter:'A',text:'It introduces an observation, presents an explanation, and then describes an exception that casts doubt on that explanation.'},{letter:'B',text:'It discusses two different responses to the same phenomenon, explains one, and suggests the other still needs to be explained.'},{letter:'C',text:'It presents a study result, indicates similarity to other studies, and attributes a conflicting result to a difference in methods.'},{letter:'D',text:'It describes and accounts for a finding, characterizes the finding as representative of a general pattern, and then describes and accounts for an exception to that pattern.'}],correctAnswer:'D'},// Question 6 Module 2 - Answer: D
{id:33,module:2,domain:'information_ideas',passage:"Text 1\nIn 2015, Belem, Brazil, was named a City of Gastronomy by UNESCO in recognition of the city's unique food culture. The honor is well known among both residents and tourists. Simply by selecting Belem, UNESCO has helped bring awareness to local recipes, cooking practices, and chefs and has provided a significant boost to the city's tourism industry.\n\nText 2\nMany people in Belem's restaurant industry hoped that food tourism would increase after the city was chosen as a City of Gastronomy in 2015. However, as researcher Eerang Park and colleagues argue, cities must still create effective marketing strategies to benefit fully from being named a City of Gastronomy. Without the intentional effort that was made to promote the city's food scene, many current and potential visitors to Belem would not even be aware that it's home to uniquely delicious food.",text:'Which choice best describes a difference in how the authors of the texts view the benefits of being named a City of Gastronomy?',type:'multipleChoice',options:[{letter:'A',text:'The author of Text 1 assumes restaurant owners and chefs are most likely to benefit, but the author of Text 2 states the honor most affects tour guides.'},{letter:'B',text:'Text 1 views Belem\'s status as beneficial, but Text 2 questions whether there\'s been a benefit.'},{letter:'C',text:'Text 1 considers effects less permanent than Text 2.'},{letter:'D',text:'Text 1 states benefits are automatic, while Text 2 states effort is required to fully achieve the benefits.'}],correctAnswer:'D'},// Question 8 Module 2 - Answer: D
// (Q7 is MISSING from the PDF)
{id:34,module:2,domain:'information_ideas',passage:"A number of artists associated with hyperpop, a movement in electronic music that emerged in the 2010s, aggressively manipulate their recorded voice. The musician Arca, for example, sometimes shifts the pitch of her vocals to be much higher than that of her natural range. And even the hyperpop artists who don't rely on pitch-shifting, such as Namasenda, often distort their vocals using digital tools. By persistently modifying the voice, hyperpop invites the listener to reflect on the extent to which digital technology mediates the human experience today.",text:'Which description of vocal manipulation in hyperpop is best supported by the text?',type:'multipleChoice',options:[{letter:'A',text:'It symbolizes the power of contemporary music to influence listeners\' sense of self.'},{letter:'B',text:'It represents the continuity of human experience despite social and historical change.'},{letter:'C',text:'It serves as an example of digital technology\'s negative influence on daily life.'},{letter:'D',text:'It functions as a commentary on contemporary social conditions.'}],correctAnswer:'D'},// Question 9 Module 2 - Answer: D
{id:35,module:2,domain:'information_ideas',passage:"Pyramids in Egypt and the Americas\n\n| Pyramid | Country | Height (meters) | Age (years before present) |\n|---------|---------|-----------------|---------------------------|\n| The Tikal Temple IV | Guatemala | 70 | 1,300 |\n| The Pyramid of the Moon | Mexico | 54 | 2,000 |\n| The Pyramid of Neferirkare | Egypt | 42 | 4,400 to 4,500 |\n| The Buried Pyramid | Egypt | 7 | 4,600 to 4,700 |\n\nA student is writing an essay about four pyramids and wants to note how long ago each was built and how tall each is. Consulting the table, the student finds that the Tikal Temple IV was built 1,300 years ago and is ______",text:'Which choice effectively uses data from the table to complete the text?',type:'multipleChoice',options:[{letter:'A',text:'54 meters high'},{letter:'B',text:'42 meters high'},{letter:'C',text:'7 meters high'},{letter:'D',text:'70 meters high'}],correctAnswer:'D'},// Question 10 Module 2 - Answer: C
{id:36,module:2,domain:'information_ideas',passage:"| Authors | Crop | Yield with tilling (kg/ha) | Yield no tilling (kg/ha) |\n|---------|------|---------------------------|--------------------------|\n| Martinez et al. | wheat | 4,829 | 2,894 |\n| Issaka et al. | rice | 6,400 | 6,300 |\n| Izauralde et al. | barley | 1,676 | 2,515 |\n| Bogunovic et al. | maize | 3,884 | 5,716 |\n\nMartinez and colleagues found tilling was associated with increased yield of winter wheat. But some studies found the opposite effect, raising the question of whether the increase is specific to wheat. However, this doesn't seem to be the case: ______",text:'Which choice most effectively uses data from the table to complete the assertion?',type:'multipleChoice',options:[{letter:'A',text:'Bogunovic and colleagues reported an even larger positive effect of tilling on maize.'},{letter:'B',text:'A study using winter wheat yielded 4,829 kg/ha with tilling and only 2,894 without.'},{letter:'C',text:'Fuseini Issaka and colleagues found a similar association in a study using rice.'},{letter:'D',text:'Crop yields with tilling ranged from 1,676 for barley to 6,400 for rice.'}],correctAnswer:'C'},// Question 11 Module 2 - Answer: B
{id:37,module:2,domain:'information_ideas',passage:"The phrase omo-ropmo bilak is a past-oriented expression used by members of the Yupno, an Indigenous group in Papua New Guinea. Rafael Nu\xF1ez and colleagues recorded Yupno speakers explaining temporal-related words and coded each speaker's manual gestures. Previous research found Spanish speakers refer to the front/back axis to describe events in time, and many researchers believe this tendency to make temporal distinctions along imagined linear axes is universal. However, Nu\xF1ez and colleagues claim that this tendency is not in fact ubiquitous.",text:'Which finding, if true, would most directly support Nu√±ez and colleagues\' claim?',type:'multipleChoice',options:[{letter:'A',text:'Yupno speakers typically use their left hand to make temporal gestures regardless of direction.'},{letter:'B',text:'When outdoors and referring to the future, Yupno speakers facing uphill gesture in front of themselves, whereas those facing downhill gesture behind themselves.'},{letter:'C',text:'Yupno speakers were observed making temporal gestures both indoors and outdoors, with greater frequency indoors.'},{letter:'D',text:'Some Yupno grammatical structures used when talking about time are also used in Spanish.'}],correctAnswer:'B'},// Question 12 Module 2 - Answer: D
{id:38,module:2,domain:'information_ideas',passage:"Many studies have found a positive association between levels of dissolved organic carbon and mercury in bodies of fresh water in North America. But Stephane Guedron, Delphine Tisserand, and colleagues did not find this correlation in Laos, leading some scientists to hypothesize that the association is particular to North America. However, several other studies conducted outside North America, such as one by Ida Tjerngren and colleagues in Sweden, showed similar results to the North American studies, while few have produced results similar to those of Guedron, Tisserand, and colleagues' study, suggesting that ______",text:'Which choice most logically completes the text?',type:'multipleChoice',options:[{letter:'A',text:'levels of dissolved organic carbon and mercury are both much higher in Laos than elsewhere.'},{letter:'B',text:'there were circumstances unique to Tjerngren and colleagues\' study that impeded accurate measurements.'},{letter:'C',text:'the hypothesis that the positive association is particular to North America is correct.'},{letter:'D',text:'dissolved organic carbon and mercury levels do typically rise and fall together in fresh water.'}],correctAnswer:'D'},// Question 13 Module 2 - Answer: A
{id:39,module:2,domain:'information_ideas',passage:"Some ethicists hold that the moral goodness of an individual's actions depends solely on whether the actions themselves are good, irrespective of the context. Philosopher L. Sebastian Purcell has shown that surviving works of Aztec (Nahua) philosophy express a very different view. Purcell reveals that these works posit an ethical system in which an individual's actions are judged in light of how well they accord with the individual's role in society and how well they contribute to the community. To the extent that these works are representative of Aztec thought, Purcell's analysis suggests that ______",text:'Which choice most logically completes the text?',type:'multipleChoice',options:[{letter:'A',text:'the Aztecs would have disputed the idea that the morality of an individual\'s actions can be assessed by appealing to standards of behavior that are independent of the individual\'s social circumstances.'},{letter:'B',text:'the Aztecs would not have accepted the notion that the morality of an individual\'s actions can be fairly evaluated by people who do not live in the same society.'},{letter:'C',text:'actions by members of Aztec society who contributed a great deal to their community could be judged as morally good even if inconsistent with behaviors regarded as good in all contexts.'},{letter:'D',text:'similar actions performed by people in different social roles would have been regarded as morally equivalent even if those actions led to different outcomes.'}],correctAnswer:'A'},// Question 14 Module 2 - Answer: C
{id:40,module:2,domain:'standard_conventions',passage:"The Austronesian language family includes Banjarese, Hiligaynon, and some 1,200 other languages throughout the Pacific, making it one of the largest language families in the world and of keen interest to ______ of Leiden University.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'linguist: Marian Klamer'},{letter:'B',text:'linguist, Marian Klamer,'},{letter:'C',text:'linguist Marian Klamer'},{letter:'D',text:'linguist, Marian Klamer'}],correctAnswer:'C'},// Question 15 Module 2 - Answer: C
{id:41,module:2,domain:'standard_conventions',passage:"The writer Jayne Cortez, along with others such as Haki Madhubuti and Maya Angelou, ______ commonly associated with the Black Arts movement, a loose-knit group of writers and artists active in the 1960s and the 1970s who were interested in exploring the Black American experience through their work.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'was'},{letter:'B',text:'are'},{letter:'C',text:'is'},{letter:'D',text:'were'}],correctAnswer:'C'},// Question 16 Module 2 - Answer: A
{id:42,module:2,domain:'standard_conventions',passage:"The heseb, which is written as a hieroglyph that looks like an X, and the heqat, which is written as a hieroglyph that looks like four oval items pouring out of a barrel, were ancient Egyptian units of ______ to record area and volume respectively, the heseb and heqat have since fallen out of use.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'measurement. Used'},{letter:'B',text:'measurement and used'},{letter:'C',text:'measurement, used'},{letter:'D',text:'measurement used'}],correctAnswer:'A'},// Question 17 Module 2 - Answer: D
{id:43,module:2,domain:'standard_conventions',passage:"Proto-Uralic\u2014a protolanguage, or ancestral language of a family of descendant (daughter) languages\u2014is said to be the common ancestor of all Uralic languages. This designation is ______ Proto-Uralic is only postulated, its characteristics being inferred from the linguistic properties of its thirty-seven daughters.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'hypothetical, however:'},{letter:'B',text:'hypothetical. However'},{letter:'C',text:'hypothetical: however,'},{letter:'D',text:'hypothetical, however,'}],correctAnswer:'D'},// Question 18 Module 2 - Answer: D
{id:44,module:2,domain:'standard_conventions',passage:"When ______ debuted in April 1983 as part of the exhibit Children's Art: Identity: New Work from Youth Education Program, the artworks brought vibrant visual texture to the bustling terminals of San Francisco International Airport.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'it'},{letter:'B',text:'its'},{letter:'C',text:'these'},{letter:'D',text:'they'}],correctAnswer:'D'},// Question 19 Module 2 - Answer: C
{id:45,module:2,domain:'standard_conventions',passage:"A species of Bryopsis algae produces toxins to avoid being eaten by predators. However, in some cases, the toxins the organism uses to protect itself from predation actually ______ its attractiveness to predators. The Hawaiian sea slug, for example, not only tolerates Bryopsis toxins but actually uses them for protection in the same way the algae does.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'is increasing'},{letter:'B',text:'increase'},{letter:'C',text:'increases'},{letter:'D',text:'has increased'}],correctAnswer:'C'},// Question 20 Module 2 - Answer: B
{id:46,module:2,domain:'standard_conventions',passage:"Though he's performed on many respected albums, including Blue Matter by John Scofield, drummer Dennis Chambers may be best known for his time as house drummer for the hip-hop label Sugar Hill Records. He did not play drums on the label's classic song \"Rapper's ______ he joined the label after the song's release.",text:'Which choice completes the text so that it conforms to the conventions of Standard English?',type:'multipleChoice',options:[{letter:'A',text:'Delight," however;'},{letter:'B',text:'Delight." However,'},{letter:'C',text:'Delight" however'},{letter:'D',text:'Delight," however,'}],correctAnswer:'B'},// Question 21 Module 2 - Answer: A
{id:47,module:2,domain:'expression_ideas',passage:"With many elements, like xenon, scientists were able to isolate a relatively pure sample of the substance shortly after discovering its existence\u2014but this wasn't the case with all elements. ______ The element uranium, for instance, was discovered in 1789 but not isolated until 1841.",text:'Which choice completes the text with the most logical transition?',type:'multipleChoice',options:[{letter:'A',text:'However,'},{letter:'B',text:'Moreover,'},{letter:'C',text:'Sometimes,'},{letter:'D',text:'For example,'}],correctAnswer:'A'},// Question 22 Module 2 - Answer: B
{id:48,module:2,domain:'expression_ideas',passage:"In hindsight, given the ideas about the natural world circulating among British scientists in the 1800s, the theory of natural selection was an obvious next step. It may not have been a coincidence, ______ that Charles Darwin and Alfred Wallace arrived at the concept independently. Indeed, contrary to the popular myth of the lone genius, theirs is not the first paradigm-shifting theory to have emerged from multiple scholars working in parallel.",text:'Which choice completes the text with the most logical transition?',type:'multipleChoice',options:[{letter:'A',text:'however,'},{letter:'B',text:'then,'},{letter:'C',text:'for example,'},{letter:'D',text:'instead,'}],correctAnswer:'B'},// Question 23 Module 2 - Answer: D
{id:49,module:2,domain:'expression_ideas',passage:"A band might choose a name that is as unique and original as possible. ______ they might name themselves after a recognizable song by a favorite band. This is what the Swedish pop rock band Roxette did when they named themselves after the song \"Roxette\" by Dr. Feelgood.",text:'Which choice completes the text with the most logical transition?',type:'multipleChoice',options:[{letter:'A',text:'For instance,'},{letter:'B',text:'In other words,'},{letter:'C',text:'Nevertheless,'},{letter:'D',text:'Alternatively,'}],correctAnswer:'D'},// Question 24 Module 2 - Answer: A
{id:50,module:2,domain:'expression_ideas',passage:"With over five decades of hit singles, including \"Lately\" from the album Hotter than July, Stevie Wonder looms over the history of pop music with near peerless talent and longevity. ______ in 1989, his legacy earned him one of the music industry's top honors: a spot in the Rock & Roll Hall of Fame.",text:'Which choice completes the text with the most logical transition?',type:'multipleChoice',options:[{letter:'A',text:'Accordingly,'},{letter:'B',text:'Besides,'},{letter:'C',text:'In other words,'},{letter:'D',text:'However,'}],correctAnswer:'A'},// Question 25 Module 2 - Answer: B
{id:51,module:2,domain:'expression_ideas',passage:"While researching a topic, a student has taken the following notes:\n\u2022 Elizabeth Catlett's sculpture Recognition (1970) shows two African American figures with rounded, indistinct features.\n\u2022 The figures reach out to each other in a pose that symbolizes a close, supportive relationship.\n\u2022 Her sculpture Students Aspire (1978) shows two African American figures with sharply defined features.\n\u2022 The figures hold an equal sign above their heads with one hand and embrace each other with the other hand.\n\u2022 This pose symbolizes their support for each other in the pursuit of equality.\n\nThe student wants to emphasize a similarity between the two sculptures.",text:'Which choice most effectively uses relevant information from the notes to accomplish this goal?',type:'multipleChoice',options:[{letter:'A',text:'Catlett\'s Students Aspire depicts two figures supporting each other in the pursuit of equality.'},{letter:'B',text:'Recognition and Students Aspire both show African American figures in poses that symbolize supportive relationships.'},{letter:'C',text:'Catlett completed Recognition in 1970 and Students Aspire in 1978.'},{letter:'D',text:'The figures in Recognition have features that are rounded and indistinct, while the figures in Students Aspire have sharply defined features.'}],correctAnswer:'B'},// Question 26 Module 2 - Answer: D
{id:52,module:2,domain:'expression_ideas',passage:"While researching a topic, a student has taken the following notes:\n\u2022 Tepeapulco is a municipality in the state of Hidalgo, Mexico.\n\u2022 Municipalities are governmental regions responsible for providing many public services to their residents.\n\u2022 One service they provide is water treatment.\n\u2022 Tepeapulco's population was 56,245 in 2020.\n\u2022 Hidalgo is divided into 84 municipalities.\n\nThe student wants to provide an example of a public service that Tepeapulco is responsible for.",text:'Which choice most effectively uses relevant information from the notes to accomplish this goal?',type:'multipleChoice',options:[{letter:'A',text:'Tepeapulco is one of 84 municipalities in Hidalgo providing public services to its communities.'},{letter:'B',text:'Tepeapulco‚Äîa governmental region in the state of Hidalgo, Mexico‚Äîprovides public services to its residents.'},{letter:'C',text:'In 2020, the municipality of Tepeapulco had a population of 56,245.'},{letter:'D',text:'As a municipality, Tepeapulco is responsible for providing water treatment to its residents.'}],correctAnswer:'D'},// Question 27 Module 2 - Answer: C
{id:53,module:2,domain:'expression_ideas',passage:"While researching a topic, a student has taken the following notes:\n\u2022 The Mohs scale of mineral hardness is a ten-point scale that orders minerals by hardness based on their ability to scratch other minerals.\n\u2022 Minerals with larger numbers are harder and can leave visible scratches on softer minerals.\n\u2022 Minerals with smaller numbers are softer and cannot leave visible scratches on harder minerals.\n\u2022 Fluorite has a Mohs number of 4.\n\u2022 Orthoclase has a Mohs number of 6.\n\u2022 Corundum has a Mohs number of 9.\n\nThe student wants to compare the hardness of fluorite and corundum.",text:'Which choice most effectively uses relevant information from the notes to accomplish this goal?',type:'multipleChoice',options:[{letter:'A',text:'The Mohs scale can be used to order orthoclase, fluorite, and corundum.'},{letter:'B',text:'A mineral with a Mohs number of 6, like orthoclase, is harder than one with a Mohs number of 4, like fluorite.'},{letter:'C',text:'Corundum can leave visible scratches on fluorite, which means that corundum is harder than fluorite.'},{letter:'D',text:'Corundum can leave visible scratches on orthoclase, meaning corundum has a higher number on the Mohs scale.'}],correctAnswer:'C'}]};

sourcesContent:
// R/W Practice Set 3
// Module 2 Question 7 is MISSING from the source PDF
// Module 1: 27 questions (ids 1-27)
// Module 2: 26 questions (ids 28-53, Q7 skipped)
// Total: 53 questions
//
// IMPORTANT: Answers were determined based on SAT content knowledge and semantic analysis.
// No official answer key was provided for this practice set.
// Users should verify all answers, especially if used for studying or assessment.

export const rwPracticeSet3 = {
  id: 'rw-set3',
  name: 'R/W Practice Set 3',
  type: 'readingWriting',
  questions: [
    // ========================================
    // MODULE 1: Reading and Writing (27 questions)
    // ========================================

    // Question 1 - Answer: D
    {
      id: 1,
      module: 1,
      domain: 'craft_structure',
      passage: `The National Heritage Fellowship was created to honor exceptional folk and traditional artists in the United States. In 2008, the fellowship was given to quilter Bettye Kimbrell. Kimbrell was ______ to receive it because of the lifetime contribution to the arts.`,
      text: 'Which choice completes the text with the most logical and precise word or phrase?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'confused' },
        { letter: 'B', text: 'ineligible' },
        { letter: 'C', text: 'reluctant' },
        { letter: 'D', text: 'chosen' }
      ],
      correctAnswer: 'D'
    },

    // Question 2 - Answer: B
    {
      id: 2,
      module: 1,
      domain: 'craft_structure',
      passage: `The following text is adapted from Willa Cather's 1912 novel Alexander's Bridge.

For the next few days Alexander was very busy. He took a desk in the office of a Scottish engineering firm on Henrietta Street, and was at work almost constantly. He avoided the clubs and usually dined alone at his hotel.`,
      text: 'As used in the text, what does the word "constantly" most nearly mean?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Enough' },
        { letter: 'B', text: 'Nonstop' },
        { letter: 'C', text: 'Quickly' },
        { letter: 'D', text: 'Fearfully' }
      ],
      correctAnswer: 'B'
    },

    // Question 3 - Answer: A
    {
      id: 3,
      module: 1,
      domain: 'craft_structure',
      passage: `According to a team of neuroeconomists from the University of Zurich, ease of decision making may be linked to communication between two brain regions, the prefrontal cortex and the parietal cortex. Individuals tend to be more decisive if the information flow between the regions is intensified, whereas they make choices more slowly when information flow is ______`,
      text: 'Which choice completes the text with the most logical and precise word or phrase?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'reduced' },
        { letter: 'B', text: 'evaluated' },
        { letter: 'C', text: 'determined' },
        { letter: 'D', text: 'acquired' }
      ],
      correctAnswer: 'A'
    },

    // Question 4 - Answer: B
    {
      id: 4,
      module: 1,
      domain: 'craft_structure',
      passage: `Ecologist Exequiel Ezcurra and colleagues found that the inhabitants of the Mexica empire used natural landmarks to track time with a high degree of ______. By observing the sun's position in relation to various points on the mountains surrounding the Basin of Mexico, the Mexica were able to precisely identify the dates when significant events such as solstices occurred.`,
      text: 'Which choice completes the text with the most logical and precise word or phrase?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'precariousness' },
        { letter: 'B', text: 'exactitude' },
        { letter: 'C', text: 'resilience' },
        { letter: 'D', text: 'inconspicuousness' }
      ],
      correctAnswer: 'B'
    },

    // Question 5 - Answer: D
    {
      id: 5,
      module: 1,
      domain: 'information_ideas',
      passage: `Steepletop in Austerlitz, New York, is the house where Edna St. Vincent Millay lived for twenty-five years and wrote many of her poems. Now the house is a museum dedicated to Millay's life and writings. Visitors travel to this museum to feel more connected to an author they admire. To encourage that sense of connection, the museum's curators recommend nearby hiking trails and outdoor activities. Such activities help visitors appreciate the natural scenery that inspired Millay.`,
      text: 'Which choice best states the main purpose of the text?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'To compare Steepletop with other museums' },
        { letter: 'B', text: 'To explain why readers enjoy Millay\'s works' },
        { letter: 'C', text: 'To summarize Millay\'s biography' },
        { letter: 'D', text: 'To describe a museum focused on Millay\'s life and works' }
      ],
      correctAnswer: 'D'
    },

    // Question 6 - Answer: D
    {
      id: 6,
      module: 1,
      domain: 'craft_structure',
      passage: `Sheep and falcons can see in three dimensions (3D), which helps them perceive distance and depth. Octopuses and squid are thought to lack 3D vision. Many researchers once thought the same about cuttlefish, but Trevor Wardill and his team wanted to test whether this assumption was true. The team studied how cuttlefish wearing 3D glasses reacted to 3D images of shrimp (a favorite prey) projected on a tank wall. Cuttlefish changed their striking position to match the 3D images, suggesting that their vision is more like that of sheep and falcons than that of octopuses or squid.`,
      text: 'Which choice best states the function of the underlined sentence in the text as a whole?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'It explains how 3D vision in sheep and falcons differs from the type of 3D vision discussed in the text.' },
        { letter: 'B', text: 'It explains why the animals discussed in the text were once thought to lack 3D vision.' },
        { letter: 'C', text: 'It offers a suggestion for future research on the aspect of 3D vision discussed in the text.' },
        { letter: 'D', text: 'It presents the results of the study of 3D vision discussed in the text.' }
      ],
      correctAnswer: 'D'
    },

    // Question 7 - Answer: A
    {
      id: 7,
      module: 1,
      domain: 'craft_structure',
      passage: `Mexico City has high pedestrian traffic, but simply replicating a feature of Mexico City associated with walkability‚Äîe.g., its high block density‚Äîmay be insufficient to induce increased walking in other cities. As urbanist Mariela Alfonzo argues, our understanding of individuals' decision-making about whether to walk is insufficiently robust: some studies emphasize the role of sidewalk width, others the role of neighborhood attractiveness, and so on, but walking decisions are made in complex contexts in which multiple conditions and needs inform individuals' choices.`,
      text: 'Which choice best describes the function of the references to "sidewalk width" and "neighborhood attractiveness" in the text as a whole?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'They represent factors that have been identified as important influences on walking decisions but that the text suggests are merely some of the many factors that may contribute to people\'s decision-making about walking.' },
        { letter: 'B', text: 'They illustrate factors that researchers believe people consider when making walking decisions in most contexts but that the text argues are unique to walking decisions made by people in Mexico City.' },
        { letter: 'C', text: 'They identify factors that Alfonzo argues have been overemphasized in studies of decision-making about walking but that the text asserts are relevant to most people\'s walking decisions.' },
        { letter: 'D', text: 'They are examples of factors that studies suggest are important in people\'s decision-making about walking but that the text claims most people rarely consider when making walking decisions.' }
      ],
      correctAnswer: 'A'
    },

    // Question 8 - Answer: D
    {
      id: 8,
      module: 1,
      domain: 'information_ideas',
      passage: `The following text is Emily Dickinson's circa 1873 poem "There is no Frigate like a Book". A frigate is a light fast ship; coursers are swift horses.

There is no Frigate like a Book
To take us Lands away
Nor any Coursers like a Page
Of prancing Poetry‚Äî
This Traverse may the poorest take
Without oppress of Toll‚Äî
How frugal is the Chariot
That bears the Human soul.`,
      text: 'Which choice best states the main idea of the text?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Reading gives people a reprieve from the financial focus of modern life.' },
        { letter: 'B', text: 'Poetry can forge connections between people from different communities.' },
        { letter: 'C', text: 'People can learn more about distant places by reading books than by traveling to those places.' },
        { letter: 'D', text: 'Literature can metaphorically transport people to new places regardless of their means.' }
      ],
      correctAnswer: 'D'
    },

    // Question 9 - Answer: D
    {
      id: 9,
      module: 1,
      domain: 'information_ideas',
      passage: `Tanya Tagaq is a writer and musician and a member of the Inuit community of Cambridge Bay in northern Canada. Critics and fellow writers have praised her work for combining traditional Inuit stories with popular genres of literature, such as fantasy fiction. But Tagaq is not the only Indigenous writer to blend traditional stories with popular literature. In the 2016 novel Wrist, Nathan Niigan Noodin Adler successfully blended the oral storytelling tradition of their people, the Anishinaabe, with horror fiction.`,
      text: 'Which choice best states the main idea of the text?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Several famous Indigenous writers increased their book sales when they began incorporating traditional stories.' },
        { letter: 'B', text: 'The success of Tanya Tagaq has influenced non-Indigenous authors who write in popular literary genres.' },
        { letter: 'C', text: 'Non-Indigenous authors should consider the experience of Indigenous readers.' },
        { letter: 'D', text: 'Recent Indigenous fiction writers are mixing traditional stories with popular literary genres.' }
      ],
      correctAnswer: 'D'
    },

    // Question 10 - Answer: A
    {
      id: 10,
      module: 1,
      domain: 'information_ideas',
      passage: `Uncle Vanya: Scenes From Country Life in Four Acts is an 1898 play by Anton Chekhov, originally written in Russian. In the play, professor Serebryakov and his wife Helena have come to stay at their country estate which Vanya manages with the help of Sonya, the professor's daughter from a previous marriage. Chekhov portrays the professor as being unable to adjust to living at the country estate, as is evident when ______`,
      text: 'Which quotation from a translation of Uncle Vanya most effectively illustrates the claim?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Professor Serebryakov says to Helena, "I am used to my library and the lecture hall and to the esteem and admiration of my colleagues... suddenly find myself plunged into this wilderness [the estate], condemned to see the same stupid people from morning till night and listen to their futile conversations."' },
